-- ----------------------------
-- Table structure for token_info
-- ----------------------------
DROP TABLE IF EXISTS `token_info`;
CREATE TABLE `token_info`  (
  `id` bigint(0) UNSIGNED NOT NULL AUTO_INCREMENT COMMENT '主键ID',
  `base_ccy` varchar(30) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '交易货币币种',
  `ct_mult` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '合约乘数，仅适用于交割/永续/期权',
  `list_date` datetime(0) NULL DEFAULT NULL COMMENT '上线日期',
  `ct_val` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '合约面值，仅适用于交割/永续/期权',
  `ct_val_ccy` varchar(155) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '合约面值计价币种，仅适用于交割/永续/期权',
  `exp_date` datetime(0) NULL DEFAULT NULL COMMENT '交割/行权日期，仅适用于交割 和 期权',
  `inst_family` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '交易品种，如 BTC-USD，仅适用于交割/永续/期权',
  `inst_id` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '产品id， 如 BTC-USD-SWAP',
  `inst_type` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT ' 产品类型\r\n      币币 SPOT\r\n      币币杠杆 MARGIN\r\n      永续合约 SWAP\r\n      交割合约 FUTURES\r\n      期权 OPTION\r\n',
  `lever` varchar(20) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '该instId支持的最大杠杆倍数，不适用于币币、期权',
  `lot_sz` varchar(20) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '下单数量精度，如 BTC-USDT-SWAP：1',
  `max_iceberg_sz` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '合约或现货冰山委托的单笔最大委托数量',
  `max_lmt_sz` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL,
  `max_mkt_sz` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '合约或现货市价单的单笔最大委托数量',
  `max_stop_sz` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '合约或现货止盈止损委托的单笔最大委托数量',
  `max_trigger_sz` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '合约或现货计划委托委托的单笔最大委托数量',
  `max_twap_sz` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '合约或现货时间加权单的单笔最大委托数量',
  `min_sz` varchar(25) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '最小下单数量',
  `opt_type` varchar(15) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '期权类型，C或P 仅适用于期权',
  `quote_ccy` varchar(20) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '计价货币币种，如 BTC-USDT 中的USDT ，仅适用于币币/币币杠杆',
  `settle_ccy` varchar(20) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '盈亏结算和保证金币种，如 BTC 仅适用于交割/永续/期权',
  `state` varchar(10) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '/**\r\n     * 产品状态\r\n     * live：交易中\r\n     * suspend：暂停中\r\n     * preopen：预上线\r\n     * test：测试中（测试产品，不可交易）\r\n     * 当合约预上线时，状态变更为预上线（即新生成一个合约，新合约会处于预上线状态）；\r\n     * 当产品下线的时候（如交割合约被交割的时候，期权合约被行权的时候），查询不到该产品\r\n     */',
  `stk` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '行权价格，仅适用于期权',
  `tick_sz` varchar(30) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '下单价格精度，如 0.0001',
  `uly` varchar(15) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '标的指数，如 BTC-USD，仅适用于交割/永续/期权',
  `exchange_type` tinyint(0) NOT NULL COMMENT '交易所类型\r\n      1 币安交易所\r\n      2 欧易交易所\r\n      3 芝麻开门交易所',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 805 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci ROW_FORMAT = Dynamic;

-- ----------------------------
-- Records of token_info
-- ----------------------------

-- ----------------------------
-- Table structure for token_rank
-- ----------------------------
DROP TABLE IF EXISTS `token_rank`;
CREATE TABLE `token_rank`  (
  `id` int(0) NOT NULL AUTO_INCREMENT,
  `token_base_name` varchar(25) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT '币种基础名称',
  `event` tinyint(0) UNSIGNED NULL DEFAULT 0 COMMENT '是否有最新事件触发(0:没有 1：有)',
  `hot` tinyint(0) UNSIGNED NULL DEFAULT 0 COMMENT '是否有近期热点消息(0:没有 1：有)',
  `cap_ranking` int(0) UNSIGNED NULL DEFAULT 0 COMMENT '市值排名',
  `vol_ranking` double NULL DEFAULT NULL COMMENT '近期交易量',
  `concept` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '板块概念',
  `comprehensive_ranking` tinyint(0) NULL DEFAULT NULL COMMENT '根据币种成交量 热度等生成的排名值 排名值越高币种策略价值越高',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 100 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci ROW_FORMAT = Dynamic;

-- ----------------------------
-- Records of token_rank
-- ----------------------------

SET FOREIGN_KEY_CHECKS = 1;
